import styled from "styled-components";

export const NavbarContainer = styled.div`
    width: 100%;
    height: 100px;
    position: sticky;
    top: 3%;
    z-index: 99;
    background-color: black;
    
`;

export const NavbarWrapper = styled.div`
    margin: auto;
    width: 100%;
    width: 1000px;
    height: 100px;
    align-items: center;
    display: flex;
    flex-wrap: wrap;
    justify-content: ;
    border: 1px solid yellow;
    
`;
